import React from 'react'
import Logo from '../assets/logo.jpg'
function Navbar() {
    return (
        <div className="navbar">
            <div className="leftSide">
                // eslint-disable-next-line jsx-a11y/alt-text
                <img src={Logo} />
            </div>
            <div className="rightSide"></div>
        </div>
    )
}

export default Navbar
